export const fetchPostData = async (postId) => {
  try {
    const response = await fetch("https://jsonplaceholder.typicode.com/posts/1");
    console.log("a",response)
    const data = await response.json();
    console.log(data)
    return data;
  } catch (e) {
    console.log(e);
  }
};
